import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('NotoSansTamil-VariableFont_wdth,wght-normal.ttf', font);
this.addFont('NotoSansTamil-VariableFont_wdth,wght-normal.ttf', 'NotoSansTamil-VariableFont_wdth,wght', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])


export default font;